import React from 'react';
import {  Routes, Route } from 'react-router-dom';
import Login from '../components/Login'
const RoutesController = () => {
 return (
   <Routes>
            <Route exact path="/" 
              element={<Login/>}
            />
            <Route
            path="*"
            element={
              <main style={{ padding: "1rem" }}>
                <p>There's nothing here!</p>
              </main>
            }
          />
          </Routes>
 );
};

export default RoutesController;
